import Link from 'next/link';

export default function ResetPage({query}) {
    if(!query?.token){
        return (
            <div>
                <h2>Please visit Sign In page to send a password reset token to your email.</h2>

                <button type="button">
                    <Link href="/signin">Sign In</Link>
                </button>

            </div>
        )
    };
    return (
        <div>
            <p>Reset Your Password {query.token}</p>
        </div>
    )
};
